package com.xinyan.mms.materials.query;/** * 仓库字典表 */public class QueryStore_Dictionary {    private int store_coding;    private String store_name;    @Override    public String toString( ) {        return "QueryStore_Dictionary{" +                "store_coding=" + store_coding +                ", store_name='" + store_name + '\'' +                '}';    }    public int getStore_coding() {        return store_coding;    }    public void setStore_coding(int store_coding) {        this.store_coding = store_coding;    }    public String getStore_name() {        return store_name;    }    public void setStore_name(String store_name) {        this.store_name = store_name;    }}